
import { useQuery } from "@tanstack/react-query";
import { supabase } from "@/integrations/supabase/client";

// Types
export interface Match {
  id: string;
  homeTeam: string;
  awayTeam: string;
  homeTeamLogo: string;
  awayTeamLogo: string;
  date: string;
  time: string;
  venue: string;
  matchType: 'T20' | 'ODI' | 'Test';
  availableSeats: number;
  bannerImage: string;
  description: string;
  seatCategories: Array<{
    id: string;
    name: string;
    price: number;
    availableSeats: number;
    color: string;
    pointsEarned: number;
  }>;
}

// USD to INR conversion rate (approximately)
const USD_TO_INR_RATE = 1;

// Banner images mapping based on match type
const getBannerImage = (matchType: string) => {
  const images = {
    'T20': 'https://images.unsplash.com/photo-1612872087720-bb876e2e67d1?q=80&w=1307&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D',
    'ODI': 'https://images.unsplash.com/photo-1540747913346-19e32dc3e97e?q=80&w=1705&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D',
    'Test': 'https://images.unsplash.com/photo-1531415074968-036ba1b575da?q=80&w=1742&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D',
  };
  return images[matchType as keyof typeof images] || images['ODI'];
};

// Team logo mapping for popular teams
const getTeamLogo = (teamName: string, fallbackUrl: string) => {
  const teamLogos: Record<string, string> = {
    'India': 'data:image/png;base64,',
    'Australia':"data:image/jpeg;base64,",
    'England': 'https://upload.wikimedia.org/wikipedia/en/thumb/c/ce/England_cricket_team_logo.svg/1200px-England_cricket_team_logo.svg.png',
    'Pakistan': 'data:image/png;base64,',
    'New Zealand': 'data:image/png;base64,',
    'South Africa': 'data:image/png;base64,',
    'West Indies': 'data:image/png;base64,',
    'Sri Lanka': 'data:image/png;base64,',
    'Bangladesh': 'https://upload.wikimedia.org/wikipedia/en/thumb/5/5c/Bangladesh_Cricket_Board_Logo.svg/1200px-Bangladesh_Cricket_Board_Logo.svg.png',
    'Afghanistan': 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRl0iX609SRt-MV-IdoSSd3tLdZ3DGL4-x5DXb9ksrBRuz2JBzsAYNBYrA&s',
    "Ireland": "data:image/jpeg;base64,",
    "Zimbabwe": "data:image/png;base64,",
  };
  
  return teamLogos[teamName] || fallbackUrl;
};

// Fetch matches from Supabase and transform to our app format
const fetchMatches = async (): Promise<Match[]> => {
  const { data, error } = await supabase
    .from('matches')
    .select('*');
  
  if (error) {
    console.error("Error fetching matches:", error);
    throw error;
  }
  
  // Transform database matches to our application format
  return (data || []).map(match => {
    // Extract time from date
    const matchDate = new Date(match.match_date);
    const formattedDate = matchDate.toISOString().split('T')[0];
    const formattedTime = matchDate.toTimeString().substring(0, 5);
    
    // Convert price to INR
    const basePriceINR = Math.round(Number(match.price) * USD_TO_INR_RATE);
    
    // Get team logos
    const team1Logo = getTeamLogo(match.team1, `https://via.placeholder.com/96?text=${match.team1.substring(0, 3)}`);
    const team2Logo = getTeamLogo(match.team2, `https://via.placeholder.com/96?text=${match.team2.substring(0, 3)}`);
    
    return {
      id: match.id,
      homeTeam: match.team1,
      awayTeam: match.team2,
      homeTeamLogo: team1Logo,
      awayTeamLogo: team2Logo,
      date: formattedDate,
      time: formattedTime,
      venue: match.venue,
      matchType: match.match_type as 'T20' | 'ODI' | 'Test',
      availableSeats: match.available_seats,
      bannerImage: getBannerImage(match.match_type),
      description: `An exciting ${match.match_type} match between ${match.team1} and ${match.team2} at the ${match.venue}.`,
      seatCategories: [
        { 
          id: `${match.id}-premium`, 
          name: "Premium", 
          price: Math.round(basePriceINR * 1.5), 
          availableSeats: Math.floor(match.available_seats * 0.2), 
          color: "platinum", 
          pointsEarned: Math.floor(basePriceINR * 0.03) 
        },
        { 
          id: `${match.id}-gold`, 
          name: "Gold", 
          price: Math.round(basePriceINR * 1.2), 
          availableSeats: Math.floor(match.available_seats * 0.3), 
          color: "gold", 
          pointsEarned: Math.floor(basePriceINR * 0.02) 
        },
        { 
          id: `${match.id}-silver`, 
          name: "Silver", 
          price: basePriceINR, 
          availableSeats: Math.floor(match.available_seats * 0.5), 
          color: "silver", 
          pointsEarned: Math.floor(basePriceINR * 0.01) 
        }
      ]
    };
  });
};

const fetchMatchById = async (id: string): Promise<Match | undefined> => {
  const { data, error } = await supabase
    .from('matches')
    .select('*')
    .eq('id', id)
    .single();
  
  if (error) {
    console.error("Error fetching match:", error);
    if (error.code !== 'PGRST116') { // Don't throw on "no rows returned"
      throw error;
    }
    return undefined;
  }
  
  if (!data) return undefined;
  
  // Transform to our app format
  const matchDate = new Date(data.match_date);
  const formattedDate = matchDate.toISOString().split('T')[0];
  const formattedTime = matchDate.toTimeString().substring(0, 5);
  
  // Convert price to INR
  const basePriceINR = Math.round(Number(data.price) * USD_TO_INR_RATE);
  
  // Get team logos
  const team1Logo = getTeamLogo(data.team1, `https://via.placeholder.com/96?text=${data.team1.substring(0, 3)}`);
  const team2Logo = getTeamLogo(data.team2, `https://via.placeholder.com/96?text=${data.team2.substring(0, 3)}`);
  
  return {
    id: data.id,
    homeTeam: data.team1,
    awayTeam: data.team2,
    homeTeamLogo: team1Logo,
    awayTeamLogo: team2Logo,
    date: formattedDate,
    time: formattedTime,
    venue: data.venue,
    matchType: data.match_type as 'T20' | 'ODI' | 'Test',
    availableSeats: data.available_seats,
    bannerImage: getBannerImage(data.match_type),
    description: `An exciting ${data.match_type} match between ${data.team1} and ${data.team2} at the ${data.venue}.`,
    seatCategories: [
      { 
        id: `${data.id}-premium`, 
        name: "Premium", 
        price: Math.round(basePriceINR * 1.5), 
        availableSeats: Math.floor(data.available_seats * 0.2), 
        color: "platinum", 
        pointsEarned: Math.floor(basePriceINR * 0.03) 
      },
      { 
        id: `${data.id}-gold`, 
        name: "Gold", 
        price: Math.round(basePriceINR * 1.2), 
        availableSeats: Math.floor(data.available_seats * 0.3), 
        color: "gold", 
        pointsEarned: Math.floor(basePriceINR * 0.02) 
      },
      { 
        id: `${data.id}-silver`, 
        name: "Silver", 
        price: basePriceINR, 
        availableSeats: Math.floor(data.available_seats * 0.5), 
        color: "silver", 
        pointsEarned: Math.floor(basePriceINR * 0.01) 
      }
    ]
  };
};

// Custom hooks
export const useMatches = () => {
  return useQuery({
    queryKey: ['matches'],
    queryFn: fetchMatches,
  });
};

export const useMatch = (id: string) => {
  return useQuery({
    queryKey: ['match', id],
    queryFn: () => fetchMatchById(id),
    enabled: !!id,
  });
};

// Filter functions
export const filterMatchesByType = (matches: Match[], type?: 'T20' | 'ODI' | 'Test') => {
  if (!type) return matches;
  return matches.filter(match => match.matchType === type);
};

export const filterMatchesByTeam = (matches: Match[], team?: string) => {
  if (!team) return matches;
  const teamLower = team.toLowerCase();
  return matches.filter(
    match => 
      match.homeTeam.toLowerCase().includes(teamLower) || 
      match.awayTeam.toLowerCase().includes(teamLower)
  );
};

export const filterMatchesByDate = (matches: Match[], startDate?: Date, endDate?: Date) => {
  if (!startDate && !endDate) return matches;
  
  return matches.filter(match => {
    const matchDate = new Date(match.date);
    
    if (startDate && endDate) {
      return matchDate >= startDate && matchDate <= endDate;
    }
    
    if (startDate) {
      return matchDate >= startDate;
    }
    
    if (endDate) {
      return matchDate <= endDate;
    }
    
    return true;
  });
};
